import Counter from "./components/Counter";
import Episodes from "./components/Episodes";
import ReactExercises from "./components/ReactExercises";

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <Counter></Counter>
      <Episodes></Episodes>
      <ReactExercises></ReactExercises>
    </div>
  );
}

export default App;
